import { createSlice } from 'redux-starter-kit';

const initialState = {
  lifts: [
    {
      name: 'DEADLIFT',
      sets: []
    }
  ]
};

const currentWorkout = createSlice({
  slice: 'currentWorkout',
  initialState: initialState,
  reducers: {}
});

export default currentWorkout;
